reports.query:
MATCH (n)-[r]-(m)
WHERE n.name = $neodash_selected_name
AND NOT type(r) STARTS WITH 'SIMILAR'
RETURN n, r, m
UNION
MATCH (n)
WHERE n.name = $neodash_selected_name
WITH n._leid_id as leid_id
MATCH (n)-[r]-(m)
WHERE n._leid_id = m._leid_id=leid_id
RETURN n, r, m

